import React from "react";
import { Col, Container, Row, Card } from "react-bootstrap";
import a from "./img/team/1.jpg";
import b from "./img/b.jpg";
import c from "./img/c.jpg";

const Team = (props) => {
    return (

        <Col>
        <div>

            <img className="card-img" src={props.img} alt={props.alt} style={{borderRadius: "400pt", height: "70pt", width: "80pt"}} />
            <h1>{props.name}</h1>
            <p>{props.summ}</p>

            </div>
        </Col>
    )
}

const OurTeam = () => {
    return ( 
        <div>
            <Container>
            <Row>
                    <Team img={a} name="img1" summ="fdsfdsfsfsf" alt="firstimg" />
                    <Team img={b} name="img2" summ="fdsfdsfsfsf" alt ="secondimg" />
                    <Team img={c} name="img3" summ="fdsfdsfsfsf" alt="thirdimg" />
            </Row>
            </Container>
        </div>
     );
}

export default OurTeam;
